import React, {useState} from 'react';
import { Col, Container, Row, Form, FormGroup, Label, Input, Button } from 'reactstrap';
import Header from './common/Header';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link,
  useRouteMatch,
  useParams
} from "react-router-dom";
import boboicon from '../images/icon_bomb.png';
import A1img from '../images/A1.png';

const Congrats = () => {
  return(
    <>
      <Container className="p-4 bg orrange">
        <Header />

        <main className="bg-white my-3">
          わーい


        </main>

        <footer>
          <Row
            sm="2"
            xs="1"
            className="text-center"
          >
            <Col>
              <a href="{}">プライバシーポリシー</a>
            </Col>
            <Col>
              <small>©澤井啓夫／集英社・東映アニメーション</small>
            </Col>
          </Row>
        </footer>
      </Container>
    </>
  );
}

export default Congrats;
